package ccxt

type P2b struct {
	*P2bCore
	Core          *P2bCore
	exchangeTyped *ExchangeTyped
}

func NewP2b(userConfig map[string]interface{}) *P2b {
	p := NewP2bCore()
	p.Init(userConfig)
	return &P2b{
		P2bCore:       p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}
func NewP2bFromCore(core *P2bCore) *P2b {
	return &P2b{
		P2bCore:       core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

